import React, { useState, useEffect } from 'react';
import '../../styles/Realtor/GeneratedLeads.css';

const GeneratedLeads = () => {
  const [leadsData, setLeadsData] = useState([]);

  const getDataFromZap = async () => {
    try {
      const response = await fetch("http://localhost:5000/getSellerData"); // GET request
      if (!response.ok) {
        const errorText = await response.text();
        throw new Error(`Error ${response.status}: ${errorText}`);
      }
      const data = await response.json();

      // Update leadsData with the fetched array of leads
      setLeadsData(data);

    } catch (error) {
      console.error("Error fetching data: ", error);
    }
  };

  useEffect(() => {
    getDataFromZap(); // Fetch data immediately on mount
    const intervalId = setInterval(getDataFromZap, 5000); // Poll every 5 seconds
    return () => clearInterval(intervalId);
  }, []);

  const userName = 'Jaydeep'; // Dynamic user name placeholder

  return (
    <section className="generated-leads">
      <h1 className="leads-title">Hey {userName}, your potential leads at a glance</h1>

      <div className="leads-container">
        {/* Map through leadsData to create a card for each lead */}
        {leadsData.map((lead, index) => (
          <div className="lead-card" key={index}>
            <div className="lead-info">
              <h2>Seller Lead</h2>
              <div className="lead-info-section">
                <p><strong>Full Name:</strong> {lead.LeadName}</p>
                <p><strong>Contact Number:</strong> {lead.Contact}</p>
                <p><strong>Email:</strong> {lead.LeadEmail}</p>
              </div>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default GeneratedLeads;
